import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import StudentList from './components/StudentList';
import StudentForm from './components/StudentForm';
import EnrollmentList from './components/EnrollmentList';
import EnrollmentForm from './components/EnrollmentForm';

function App() {
  return (
    <div className="min-h-screen bg-gray-100">
      <Navbar />
      <div className="container mx-auto p-6">
        <Routes>
          <Route path="/" element={<StudentList />} />
          <Route path="/estudiantes/new" element={<StudentForm />} />
          <Route path="/estudiantes/edit/:id" element={<StudentForm />} />
          <Route path="/matriculas" element={<EnrollmentList />} />
          <Route path="/matriculas/new" element={<EnrollmentForm />} />
          <Route path="/matriculas/edit/:id" element={<EnrollmentForm />} />
        </Routes>
      </div>
    </div>
  );
}

export default App;
